(r: org.apache.wayang.basic.data.Record) => {
  val invDate = r.getField(5).toString // invoice_date
  val creditorName = r.getField(9).toString // creditor name after join (assumed position)
  val year = try { val yyyy = invDate.substring(0,4).toInt; yyyy } catch { case _: Throwable => 0 }
  val keepCred = creditorName.contains("VVS") && !creditorName.contains("SLETTET")
  year == 2025 && keepCred
}

(r: org.apache.wayang.basic.data.Record) => {
  // extract creditor_id, creditor_name, and price for aggregation
  val creditorId = r.getField(3).toString.toInt
  val creditorName = r.getField(9).toString
  val price = r.getField(8).toString.toDouble
  (creditorId, creditorName, price)
}

